/*
 * @Author: your name
 * @Date: 2022-04-07 11:58:39
 * @LastEditTime: 2022-04-28 13:54:30
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\components\GlobalTabel\index.js
 */
import React, { useState } from 'react';
import { Table, Popconfirm, Form, Select, Modal, message, Divider } from 'antd';
import { toJS } from 'mobx';
import { GlobalComponent } from 'layouts/TableEdit/config';
import { typeName } from 'constants/status_constant';
import TableLayout from 'components/TableLayout';
import { inject, observer } from 'mobx-react';


@inject('HomeStore','TableStore')
@observer
class GlobalTabel2 extends React.Component {
    render() {
        const {dataSource,columns,PageInfo,isLoading} = this.props.HomeStore
        return (
            <TableLayout
                bordered
                dataSource={dataSource}
                columns={columns}
                rowClassName="editable-row"
                pagination={PageInfo}
                onChange={pageChange}
                loading={isLoading}
                scroll={{ x: 200 }}
            />
        );
    }



};

export default GlobalTabel2
